import React from 'react';
import GoalList from './components/GoalList';
import WeekGoal from './components/WeekGoal';
import './APP.css';

const App = () => {
  return (
    <div>
      <h2 className = 'title'> Week Goal:</h2>
      <h2 className = 'title2'>Today Class:</h2>
      <WeekGoal />
      <GoalList />
    </div>
  );
};

export default App;
